import React from 'react';
/** Import components */
import {
  Navbar,
  NavbarBrand,
} from 'reactstrap';
import { NavLink } from 'react-router-dom';

/** Import assets */
import logo from 'assets/images/logo.jpg';
import './topNav.css';

class TopNav extends React.Component {
  handleLogoutClick(e) {
    this.props.authActions.logout();
  }
  render() {
    // const { name } = this.props.currentUser;
    return (
      <div className="top-nav">
        <Navbar light expand className="shadow-sm bg-white p-0 h-100">
          <NavbarBrand>
            <NavLink
              activeClassName="active"
              to={`/`}
            >
                 <img src={logo} alt="ChatMatic" className="top-nav-logo" />
            </NavLink>
          </NavbarBrand>
          <NavbarBrand>
            <NavLink
              activeClassName="active"
              to={`/home`}
            >
             <i className = "fa fa-home"></i>Home
            </NavLink>
          </NavbarBrand>
          <NavbarBrand >
            <NavLink
              activeClassName="active"
              to={`/exercise`}
            >
             <i className = "fa fa-home"></i> Exercise
             </NavLink>
          </NavbarBrand>
          <NavbarBrand>
            <NavLink
              activeClassName="active"
              to={`/food`}
            >
             <i className = "fa fa-home"></i> Food
             </NavLink>
          </NavbarBrand>
          <NavbarBrand >
            <NavLink
              activeClassName="active"
              to={`/supplements`}
            >
                <i className = "fa fa-home"></i> Supplements
             </NavLink>
          </NavbarBrand>
        </Navbar>
      </div>
    );
  }
}

export default TopNav
